import React, { Component } from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faArrowAltCircleUp, faArrowsAlt } from "@fortawesome/free-solid-svg-icons";
import { faAward } from "@fortawesome/free-solid-svg-icons";
import image from '../Assets/2.png';
import { faAdobe } from '@fortawesome/free-brands-svg-icons';

class Projects extends Component {
  constructor(props) {
    super(props);

    this.project = props.project;
  }

  render() {
    return(
        <section className="resume-section p-3 p-lg-5 d-flex justify-content-center" id="project">
        <div className="w-100">
          <h2 className="mb-5">Projects</h2>          {
            this.project.map((exp, index) => (
              <div key={index} className="resume-item d-flex flex-column flex-md-row justify-content-between mb-5">
                <div className="resume-content">
                <FontAwesomeIcon icon={faArrowAltCircleUp} color="#ffc107" />
                  <h3 className="mb-1">{exp.project}</h3>
                  <p>{exp.pdetails}</p>       
                </div>
              </div>
              
            ))
          }
          
        </div>
        <div>
        <img src={image} alt="" className="pngimage1"></img>
        </div>
      </section>
      
    );
  }
}

export default Projects;
